column1:
What is the output?
Thread t = new Thread(() -> System.out.println("Hello"));
t.start();,Hello (printed in separate thread),Compilation error,Nothing printed,start() not valid

What happens with this code?
ExecutorService executor = Executors.newSingleThreadExecutor();
executor.execute(() -> System.out.println("Task"));
executor.shutdown();,Task printed,Compilation error,RejectedExecutionException,Nothing printed

What is the result?
Callable<Integer> task = () -> 5 + 3;
ExecutorService executor = Executors.newSingleThreadExecutor();
Future<Integer> future = executor.submit(task);
System.out.println(future.get());,8,Compilation error,53,ExecutionException

What is the output?
Thread t = new Thread(() -> System.out.println("Hello"));
t.run();,Hello (printed in current thread),Hello (in new thread),Compilation error,Nothing printed

What happens with Future.get()?
Future<String> future = executor.submit(() -> "Result");
String result = future.get();,Blocks until task completes,Returns immediately,Compilation error,Returns null

What is the result?
Thread t = new Thread(() -> System.out.println("Test"));
t.start();
t.start();,IllegalThreadStateException,Test printed twice,Compilation error,Nothing happens

What is the output?
ExecutorService executor = Executors.newCachedThreadPool();
executor.submit(() -> System.out.println("Task"));
executor.shutdown();,Task printed,Compilation error,Executor rejects task,Nothing printed

What happens with shutdown()?
ExecutorService executor = Executors.newSingleThreadExecutor();
executor.shutdown();
executor.submit(() -> System.out.println("Task"));,RejectedExecutionException,Task executed,Compilation error,Waits for shutdown

What is the result?
Thread t = new Thread(() -> {
    try { Thread.sleep(1000); }
    catch (InterruptedException e) {}
});
t.start();,Thread sleeps for 1 second,Compilation error,Thread runs immediately,InterruptedException always thrown

What is the output?
Callable<Integer> task = () -> { throw new Exception("Error"); };
Future<Integer> future = executor.submit(task);
future.get();,ExecutionException thrown,Compilation error,Exception printed,Returns null

What happens with isDone()?
Future<String> future = executor.submit(() -> "Done");
System.out.println(future.isDone());,"false initially, true when complete",Always true,Always false,Compilation error

What is the result?
ExecutorService executor = Executors.newSingleThreadExecutor();
executor.execute(() -> System.out.println("Task"));,Task printed,Compilation error,execute() not valid,Returns Future

What is the output?
Thread t1 = new Thread(() -> System.out.print("A"));
Thread t2 = new Thread(() -> System.out.print("B"));
t1.start();
t2.start();,A and B in any order,AB always,BA always,Compilation error

What is the result?
Future<Integer> future = executor.submit(() -> 10);
System.out.println(future.get(1, TimeUnit.SECONDS));,10 (if completes in 1 second),TimeoutException always,Compilation error,Waits forever

What is the output?
Runnable task = () -> {
    for (int i = 0; i < 3; i++)
        System.out.print(i);
};
new Thread(task).start();,012,123,0 1 2,Compilation error

What happens with ExecutorService.submit(Runnable)?
ExecutorService executor = Executors.newSingleThreadExecutor();
Future<?> future = executor.submit(() -> System.out.println("Task"));
System.out.println(future.get());,null (after task completes),Task,Compilation error,Future<Void>

What is the result?
ScheduledExecutorService executor = Executors.newScheduledThreadPool(1);
executor.schedule(() -> System.out.println("Task"), 1, TimeUnit.SECONDS);,Task printed after 1 second,Task printed immediately,Compilation error,Task never printed

What happens with interrupt()?
Thread t = new Thread(() -> {
    try { Thread.sleep(10000); }
    catch (InterruptedException e) { System.out.println("Interrupted"); }
});
t.start();
t.interrupt();,Interrupted printed,Thread continues sleeping,Compilation error,Thread stops immediately

What is the result?
ExecutorService executor = Executors.newFixedThreadPool(2);
Future<Integer> f1 = executor.submit(() -> 5);
Future<Integer> f2 = executor.submit(() -> 10);
System.out.println(f1.get() + f2.get());,15,510,Compilation error,5

What is the output?
Callable<String> task = () -> {
    Thread.sleep(100);
    return "Done";
};
Future<String> future = executor.submit(task);
System.out.println(future.get());,Done,Compilation error,null,100

What happens with awaitTermination()?
executor.shutdown();
executor.awaitTermination(1, TimeUnit.SECONDS);,Waits up to 1 second for tasks to complete,Immediately terminates,Compilation error,Waits forever

What is the result?
Thread t = new Thread(() -> System.out.println("Task"));
System.out.println(t.getState());,NEW,RUNNABLE,RUNNING,Compilation error

What is the output?
ExecutorService executor = Executors.newFixedThreadPool(1);
executor.submit(() -> System.out.println("A"));
executor.submit(() -> System.out.println("B"));
executor.shutdown();,A and B printed,Only A printed,Compilation error,Neither printed

What happens with isShutdown()?
ExecutorService executor = Executors.newSingleThreadExecutor();
executor.shutdown();
System.out.println(executor.isShutdown());,true,false,Compilation error,null

What is the result?
Runnable r = () -> System.out.println("Test");
Thread t = new Thread(r);
r.run();,Test (in current thread),Test (in new thread),Compilation error,Nothing printed

What is the output?
CompletableFuture<String> future = CompletableFuture.supplyAsync(() -> "Hello");
System.out.println(future.get());,Hello,Compilation error,null,CompletionException

What happens with invokeAll()?
List<Callable<Integer>> tasks = List.of(() -> 1, () -> 2, () -> 3);
List<Future<Integer>> futures = executor.invokeAll(tasks);,All tasks executed and Futures returned,Compilation error,Only first task executed,Returns List<Integer>

What is the result?
AtomicInteger count = new AtomicInteger(0);
count.incrementAndGet();
System.out.println(count.get());,1,0,Compilation error,2

What is the output?
CountDownLatch latch = new CountDownLatch(2);
latch.countDown();
latch.countDown();
latch.await();,Continues execution (latch released),Waits forever,Compilation error,IllegalStateException

What happens with daemon threads?
Thread t = new Thread(() -> System.out.println("Task"));
t.setDaemon(true);
t.start();,JVM can exit without waiting for daemon thread,Must wait for thread,Compilation error,Cannot set daemon after start

What is the result?
CyclicBarrier barrier = new CyclicBarrier(2);
barrier.await();,Waits for second thread,Continues immediately,Compilation error,IllegalStateException

What is the output?
Thread t = new Thread(() -> System.out.println("Task"));
t.start();
t.join();,Task printed and main waits,Compilation error,Task not printed,InterruptedException

What happens with invokeAny()?
List<Callable<String>> tasks = List.of(() -> "A", () -> "B");
String result = executor.invokeAny(tasks);,Returns result of first completed task,Returns all results,Compilation error,Waits for all tasks

What is the result?
Semaphore semaphore = new Semaphore(1);
semaphore.acquire();
semaphore.release();,Permit acquired and released,Compilation error,InterruptedException always,Deadlock

What is the output?
ExecutorService executor = Executors.newWorkStealingPool();
executor.submit(() -> System.out.println("Task"));
executor.shutdown();,Task printed,Compilation error,Not supported,Nothing printed
